// src/pages/Profile.js
import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';
import ProfileTab from '../components/ProfileTabs/ProfileTab';
import SecurityTab from '../components/ProfileTabs/SecurityTab';
import BadgesTab from '../components/ProfileTabs/BadgesTab';
import ActivityTab from '../components/ProfileTabs/ActivityTab';
import SettingsTab from '../components/ProfileTabs/SettingsTab';
import axios from 'axios';

const Profile = () => {
  const [activeTab, setActiveTab] = useState('profile');
  const [profileData, setProfileData] = useState(null);

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const response = await axios.get('/api/profile');
        setProfileData(response.data);
      } catch (error) {
        console.error('Error fetching profile:', error);
      }
    };
    fetchProfile();
  }, []);

  const renderTabContent = () => {
    switch (activeTab) {
      case 'profile':
        return <ProfileTab profileData={profileData} />;
      case 'security':
        return <SecurityTab profileData={profileData} />;
      case 'badges':
        return <BadgesTab badges={profileData?.badges} />;
      case 'activity':
        return <ActivityTab actions={profileData?.actions} />;
      case 'settings':
        return <SettingsTab />;
      default:
        return <ProfileTab profileData={profileData} />;
    }
  };

  return (
    <div className="bg-gray-100 min-h-screen">
      <Navbar />
      <main className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <h1 className="text-3xl font-bold text-center mb-8">Your Profile</h1>
        <div className="bg-white shadow rounded-lg">
          <div className="border-b border-gray-200">
            <nav className="-mb-px flex">
              <button
                onClick={() => setActiveTab('profile')}
                className={`w-1/5 py-4 px-1 text-center border-b-2 font-medium text-sm ${
                  activeTab === 'profile'
                    ? 'border-indigo-500 text-indigo-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                Profile
              </button>
              <button
                onClick={() => setActiveTab('security')}
                className={`w-1/5 py-4 px-1 text-center border-b-2 font-medium text-sm ${
                  activeTab === 'security'
                    ? 'border-indigo-500 text-indigo-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                Security
              </button>
              <button
                onClick={() => setActiveTab('badges')}
                className={`w-1/5 py-4 px-1 text-center border-b-2 font-medium text-sm ${
                  activeTab === 'badges'
                    ? 'border-indigo-500 text-indigo-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                Badges
              </button>
              <button
                onClick={() => setActiveTab('activity')}
                className={`w-1/5 py-4 px-1 text-center border-b-2 font-medium text-sm ${
                  activeTab === 'activity'
                    ? 'border-indigo-500 text-indigo-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                Activity & Stats
              </button>
              <button
                onClick={() => setActiveTab('settings')}
                className={`w-1/5 py-4 px-1 text-center border-b-2 font-medium text-sm ${
                  activeTab === 'settings'
                    ? 'border-indigo-500 text-indigo-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                Settings
              </button>
            </nav>
          </div>
          <div className="p-6">{renderTabContent()}</div>
        </div>
      </main>
    </div>
  );
};


